function calculatePhotoScale(nodeData) {
  if (nodeData.useNonePhoto) {
    return 1;
  }
  if (nodeData.birthPlace == null && nodeData.deathPlace == null) {
    return 0.35;
  }
  if (nodeData.birthPlace == null && nodeData.deathPlace != null) {
    return 0.47;
  }
  if (nodeData.birthPlace != null && nodeData.deathPlace == null) {
    return 0.47;
  }
  if (nodeData.birthPlace != null && nodeData.deathPlace != null) {
    return 0.52;
  }
  return 1;
}
